import React from 'react'

import { Formik, Field, Form } from 'formik'

const SomeQuestions = (props) => {

    return (
        <>
            <h3>Some questions</h3>
            <Formik
                initialValues={{
                    part_of_complex: '',
                    is_existing_complex: ''
                }}
                onSubmit={( data ) => console.log(data)}
            >
            {({
                values,
                handleChange,
                handleBlur
            }) => (
                <Form>
                    <div>Part of a complex</div>
                    <div>
                        <label>
                            <Field type='radio' name='part_of_complex' value='true' />
                            Yes
                        </label>
                        <label>
                            <Field type='radio' name='part_of_complex' value='false' />
                            No
                        </label>
                    </div>

                    {values.part_of_complex && (
                        <>
                            <div>Part of a complex</div>
                            <div>
                                <label>
                                    <Field type='radio' name='is_existing_complex' value='true' />
                                    Yes
                                </label>
                                <label>
                                    <Field type='radio' name='is_existing_complex' value='false' />
                                    No
                                </label>
                            </div>
                        </>
                    )}


                    <label htmlFor='email' style={{ display: 'block' }}>
                        Complex name
                    </label>
                    <select
                        name='color'
                        value={values.color}
                        onChange={handleChange}
                        onBlur={handleBlur}
                        style={{ display: 'block' }}
                    >
                        {existingComplexes__array.map((item, index) => (
                            <option value={item.value} label={item.label} />
                        ))}
                    </select>

                    <button type='submit'>Submit</button>
                </Form>
            )}
            </Formik>
        </>
    )
}

const existingComplexes__array = [
    {
        value: 'complex_1',
        label: 'Complex 1'
    },
    {
        value: 'complex_2',
        label: 'Complex 2'
    },
    {
        value: 'complex_3',
        label: 'Complex 3'
    },
    {
        value: 'complex_4',
        label: 'Complex 4'
    }
]

export default SomeQuestions
